import React from 'react';
import './navbar.css';

const navbar = (props) => {
    return (
        <div className="navbar">
            <div className="Logo" style={{display: 'flex', flexFlow: 'row', textAlign: 'center', height: '3rem'}}>
                <p style={{margin: 0, fontWeight: '900', fontSize: '1.7rem', lineHeight: '1rem'}}>Farane Javadi &nbsp;&nbsp; <span style={{fontWeight: '300', fontSize: '1.2rem', lineHeight: '1rem'}}>  / &nbsp; &nbsp;FRONT END DEVELOPER</span></p>
            </div>
            <div className="navLinks">
                <ul>
                    <li>ABOUT ME</li>
                    <li>RESUME</li>
                    <li>PROJECTS</li>
                    <li>CONTACT</li>
                </ul>
            </div>
        </div>
     );
}

export default navbar;
